import React from "react";

const About = () => {
  return (
    <div id="about" className="section">
      <h2>About Page</h2>
      <p>Hello! I'm Pooja, a software developer passionate about building modern web applications.</p>
      <p>I have expertise in Java, React, SQL, and more. Always eager to learn and create efficient solutions!</p>
    </div>
  );
};

export default About;
